CREATE TABLE IF NOT EXISTS members
(
	member_id char(10) NOT NULL,
	name varchar(32) default NULL,
	surname varchar(32) default NULL,
	email varchar(32) default NULL,
	renewal_date date default NULL,
	PRIMARY KEY (member_id), UNIQUE KEY (email)
);




 


CREATE TABLE IF NOT EXISTS items
(
	isbn char(14) NOT NULL,
	cat char(11) default NULL,
	publisher varchar(32) default NULL,
	PRIMARY KEY (isbn)
);







CREATE TABLE IF NOT EXISTS fiction
(
	isbn char(14),
	title varchar(32) default NULL,
	author varchar(32) default NULL,
	publisher varchar (32) default NULL,
	year_pub year default NULL,
	PRIMARY KEY (isbn)
);





CREATE TABLE IF NOT EXISTS non_fiction
(
	isbn char(14),
	title varchar(32) default NULL,
	author varchar(32) default NULL,
	publisher varchar (32) default NULL,
	year_pub year default NULL,
	PRIMARY KEY (isbn)
);





CREATE TABLE IF NOT EXISTS journals
(
	isbn char(14),
	title varchar(32) default NULL,
	author varchar(32) default NULL,
	publisher varchar (32) default NULL,
	year_pub year default NULL,
	discipline varchar(32) default NULL,
	PRIMARY KEY (isbn)
);






CREATE TABLE IF NOT EXISTS loans
(
	loan_id char(6),
	member_id char(10),
	isbn char(14),
	date_out date NOT NULL,
	date_due date NOT NULL,
	PRIMARY KEY(loan_id)
);


CREATE INDEX items_cat_indx
ON items(cat);

CREATE INDEX loans_isbn_indx
ON loans(isbn);

ALTER TABLE members ENGINE = InnoDB;
ALTER TABLE items ENGINE = InnoDB;
ALTER TABLE fiction ENGINE = InnoDB;
ALTER TABLE non_fiction ENGINE = InnoDB;
ALTER TABLE journals ENGINE = InnoDB;
ALTER TABLE loans ENGINE = InnoDB;

ALTER TABLE loans ADD FOREIGN KEY (member_id) REFERENCES members(member_id);
ALTER TABLE loans ADD FOREIGN KEY (isbn) REFERENCES items(isbn);
ALTER TABLE fiction ADD FOREIGN KEY (isbn) REFERENCES items(isbn) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE non_fiction ADD FOREIGN KEY (isbn) REFERENCES items(isbn) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE journals ADD FOREIGN KEY (isbn) REFERENCES items(isbn) ON DELETE CASCADE ON UPDATE CASCADE;
